function Login() {
  return (
    <section>
      <h2>Iniciar Sesión</h2>
      <form>
        <label form="text"></label>
        <input id="text" type="text" />
        <label form="password"></label>
        <input id="password" type="password" />
        <button>Iniciar Sesión</button>
      </form>
    </section>
  );
}
